import React, { Fragment } from "react";

// import components
import ChannelHeader from "../channelHeader";

// import styles
import s from "../../styles/agenda.module.css";

const OurAgenda = () => {
  return (
    <Fragment>
      <div className={s.AgendaWrapper}>
        <ChannelHeader />
        <div className={s.title}>
          <h2>Upcoming Sessions</h2>
        </div>
        <div className={s.AgendaContainer}>
          <div className={s.UpcomingSessions}>
<div className={s.Session}>
  <p>How to come up with ideas</p>
  <span>8th</span>
</div>
          </div>
          <div className={s.SessionContent}></div>
        </div>
      </div>
    </Fragment>
  );
};

export default OurAgenda;
